import MyplantsTab from "./MyPlantsTab";
import Button from 'react-bootstrap/Button';
import "./Myplants.css";


function Myplants() {

    return (
        <>
        <MyplantsTab />


        <div className= "main"> 
          <h1>누구나 <br/>쉽고 예쁘게 <br/>키울 수 있도록</h1>
          <h3>사랑스러운 식물을 추가하세요</h3>
          <Button id="myplantsbtn" variant="outline-success" href="/myplantswrite">등록하기</Button>{' '}
        </div>

        </>
    )
}

export default Myplants;
